import React from 'react';
import SuggestionCard from './card_sugges_json';
import {AiOutlinePlus} from 'react-icons/ai';
import Button from '../../../../../general/button/button'
import Modal from '../modal/modal'

class SuggestionInner extends React.Component{
  render(){
    return(
      <div className="card-deck pt-5 col-12 cardsugges">
      <div id="modal">
        <button type="button" className="btn btn-info btn-lg" data-toggle="modal" data-target="#myModal"><AiOutlinePlus/></button>
        <div className="modal fade" id="myModal" role="dialog">
          <div className="modal-dialog">
              <div className="modal-content">
      {SuggestionCard.map((item)=>{
        return(
            <div className="card">
              <center><img className=" card-img-top img-fluid" src={item.url}/></center>
              <div className="modal-header">
                <h4 className="modal-title">{item.head}</h4>
                  <button type="button" className="close" data-dismiss="modal">&times;</button>
              </div>
              <div className="modal-body">
                <div dangerouslySetInnerHTML={{__html:item.text}}>
                </div>
              </div>
              <h6 className="text-center">{item.title}</h6>
            </div>
        )})}
        <div className="modal-footer">
          <button type="button" className="btn btn-default" data-dismiss="modal">Close</button>
        </div>
      </div>
</div>
</div>
</div>
      </div>
  )}}
export default SuggestionInner
